import React, { useState, useEffect } from "react";
import axios from "axios";
import "./AdminDashboard.css";

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState("track");
  const [complaints, setComplaints] = useState([]);
  const [cancelledComplaints, setCancelledComplaints] = useState([]);
  const [trackFilter, setTrackFilter] = useState("high-low");
  const [trackStatus, setTrackStatus] = useState("pending");
  const [error, setError] = useState("");
  const [message, setMessage] = useState("");

  const [authorities, setAuthorities] = useState([]);
  const [authorityPopup, setAuthorityPopup] = useState({ visible: false, data: {}, editing: false });

  // Load complaints
  const loadComplaints = (filter = trackFilter, status = trackStatus) => {
    axios
      .get(`http://localhost:8081/Complaint-chain/api/complaints/${status}?sort=${filter}`)
      .then((res) => setComplaints(res.data))
      .catch(() => setError("❌ Failed to load complaints."));
  };

  const loadCancelledComplaints = () => {
    axios
      .get("http://localhost:8081/Complaint-chain/api/complaints/cancelled")
      .then((res) => setCancelledComplaints(res.data))
      .catch(() => setError("❌ Failed to load cancelled complaints."));
  };

  // Load authorities
  const loadAuthorities = () => {
    axios
      .get("http://localhost:8081/api/authority")
      .then((res) => setAuthorities(res.data))
      .catch(() => setError("❌ Failed to load authority profiles."));
  };

  useEffect(() => {
    if (activeTab === "track") loadComplaints();
    if (activeTab === "cancelled") loadCancelledComplaints();
    if (activeTab === "authority") loadAuthorities();
  }, [activeTab, trackFilter, trackStatus]);

  return (
    <div className="admin-home-page">
      <div className="admin-home-container">
        <h1>Admin Dashboard</h1>
        {error && <div className="cust-error">{error}</div>}
        {message && <div className="popupOverlay"><div className="successMessagePopup">{message}</div></div>}

        {/* Tabs */}
        <div className="cust-btn-group">
          <button className={`cust-btn ${activeTab === "track" ? "cust-btn-active" : ""}`} onClick={() => setActiveTab("track")}>Track Complaints</button>
          <button className={`cust-btn ${activeTab === "cancelled" ? "cust-btn-active" : ""}`} onClick={() => setActiveTab("cancelled")}>Cancelled Complaints</button>
          <button className={`cust-btn ${activeTab === "authority" ? "cust-btn-active" : ""}`} onClick={() => setActiveTab("authority")}>Authority Profiles</button>
        </div>

        {/* Track Complaints */}
        {activeTab === "track" && (
          <div className="cust-tab-box">
            <h3>Track Complaints</h3>
            <div className="filterContainer">
              <label>Status: </label>
              <select value={trackStatus} onChange={(e) => setTrackStatus(e.target.value)}>
                <option value="pending">Pending</option>
                <option value="inprogress">In Progress</option>
              </select>
              <label>Sort by: </label>
              <select value={trackFilter} onChange={(e) => setTrackFilter(e.target.value)}>
                <option value="high-low">Priority: High → Low</option>
                <option value="low-high">Priority: Low → High</option>
                <option value="date-asc">Date: Ascending</option>
                <option value="date-desc">Date: Descending</option>
              </select>
            </div>
            <table className="cust-table">
              <thead><tr><th>ID</th><th>Department</th><th>Priority</th><th>Description</th><th>Submission Date</th><th>Status</th></tr></thead>
              <tbody>
                {complaints.map(c => (
                  <tr key={c.id} style={{ backgroundColor: c.status === "In Progress" ? "#fff3cd" : "" }}>
                    <td>{c.id}</td>
                    <td>{c.department}</td>
                    <td>{c.urgency}</td>
                    <td>{c.description}</td>
                    <td>{new Date(c.submittedAt).toLocaleString()}</td>
                    <td>{c.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        {/* Cancelled Complaints */}
        {activeTab === "cancelled" && (
          <div className="cust-tab-box">
            <h3>Cancelled Complaints</h3>
            <table className="cust-table">
              <thead><tr><th>ID</th><th>Department</th><th>Priority</th><th>Description</th><th>Reason</th><th>Cancelled At</th></tr></thead>
              <tbody>
                {cancelledComplaints.map(c => (
                  <tr key={c.id}><td>{c.originalId}</td><td>{c.department}</td><td>{c.urgency}</td><td>{c.description}</td><td>{c.reason}</td><td>{new Date(c.submittedAt).toLocaleString()}</td></tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        {/* Authority Profiles */}
        {activeTab === "authority" && (
          <div className="cust-tab-box">
            <h3>Authority Profile Management</h3>

            <form onSubmit={(e) => {
              e.preventDefault();
              if (authorityPopup.editing) {
                axios.put(`http://localhost:8081/api/authority/${authorityPopup.data.id}`, authorityPopup.data)
                  .then(() => { setMessage("✅ Authority updated"); setTimeout(() => setMessage(""), 2500); loadAuthorities(); setAuthorityPopup({ visible: false, data: {}, editing: false }); })
                  .catch(() => { setError("❌ Failed to update authority"); setTimeout(() => setError(""), 2500); });
              } else {
                axios.post(`http://localhost:8081/api/authority`, authorityPopup.data)
                  .then(() => { setMessage("✅ Authority added"); setTimeout(() => setMessage(""), 2500); loadAuthorities(); setAuthorityPopup({ visible: false, data: {}, editing: false }); })
                  .catch(() => { setError("❌ Failed to add authority"); setTimeout(() => setError(""), 2500); });
              }
            }} className="cust-form-grid">
              <div className="form-group"><label>Name:</label><input type="text" value={authorityPopup.data.name || ""} onChange={e => setAuthorityPopup({ ...authorityPopup, data: { ...authorityPopup.data, name: e.target.value } })} required /></div>
              <div className="form-group"><label>Email:</label><input type="email" value={authorityPopup.data.email || ""} onChange={e => setAuthorityPopup({ ...authorityPopup, data: { ...authorityPopup.data, email: e.target.value } })} required /></div>
              <div className="form-group"><label>Phone:</label><input type="text" value={authorityPopup.data.phone || ""} onChange={e => setAuthorityPopup({ ...authorityPopup, data: { ...authorityPopup.data, phone: e.target.value } })} required /></div>
              <div className="form-group"><label>Department:</label><input type="text" value={authorityPopup.data.department || ""} onChange={e => setAuthorityPopup({ ...authorityPopup, data: { ...authorityPopup.data, department: e.target.value } })} required /></div>
              <div className="form-group"><label>Authority Level:</label>
                <select value={authorityPopup.data.level || "Low"} onChange={e => setAuthorityPopup({ ...authorityPopup, data: { ...authorityPopup.data, level: e.target.value } })}>
                  <option>Low</option>
                  <option>Medium</option>
                  <option>High</option>
                </select>
              </div>
              <div className="form-group full-width" style={{ textAlign: "center" }}>
                <button type="submit" className="cust-btn-submit">{authorityPopup.editing ? "Update" : "Add"} Authority</button>
              </div>
            </form>

            <table className="cust-table" style={{ marginTop: "20px" }}>
              <thead><tr><th>ID</th><th>Name</th><th>Email</th><th>Phone</th><th>Department</th><th>Level</th><th>Actions</th></tr></thead>
              <tbody>
                {authorities.map(a => (
                  <tr key={a.id}>
                    <td>{a.id}</td>
                    <td>{a.name}</td>
                    <td>{a.email}</td>
                    <td>{a.phone}</td>
                    <td>{a.department}</td>
                    <td>{a.level}</td>
                    <td>
                      <button onClick={() => setAuthorityPopup({ visible: true, data: a, editing: true })}>Edit</button>
                      <button onClick={() => {
                        axios.delete(`http://localhost:8081/api/authority/${a.id}`)
                          .then(() => { setMessage("✅ Authority deleted"); setTimeout(() => setMessage(""), 2500); loadAuthorities(); })
                          .catch(() => { setError("❌ Failed to delete authority"); setTimeout(() => setError(""), 2500); });
                      }}>Delete</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

      </div>
    </div>
  );
};

export default AdminDashboard;
